import react from 'react';
import { IPost } from '../../types/index'
import styles from './MediumPost.module.css';
import Controls from '../Controls/Controls';

const MediumPost = (props: IPost) => {
  return (
    <div className={styles.post + ' ' + styles.smallPost} >
      <div className={styles.post__container}>
        <div className={styles.post__date}>{props.date}</div>
        <div className={styles.post__title}>{props.title}</div>
        <div className={styles.post__img}>
          <img src={props.image} alt='Картинка' />
        </div>
      </div>
      <Controls />
    </div>
  )
};

export default MediumPost;
